import React, { Component } from 'react';
import {
  View,
  Platform,
  TextInput,
  Text
} from 'react-native';

export default class CustomTextInput extends Component {
    static propTypes = {
     text: String,
   }
 render() {
      return(
        <View>
           <Text>this.text</Text>
        </View>
      );
    }
}
